//display table employee
$(document).ready(function() {
	console.log("document ready");
	var json_path ="http://10.7.1.79/LearningDjango/employees/";
    $.ajax({
		url: "html/populate_list_employee.html",
		async:false,
		success: function(object) {
	    			$.getJSON(json_path,function(obj){
	    				for(var i=0; i<obj.data.length; i++){
	    					console.log(obj.data[i].id);
	    					$('#viewDetails').append(object); 
	    					$("input[name=selected]").last().attr("id",obj.data[i].id);
	    					$('tr:last-child #eID').html(obj.data[i].id);
	    					$('tr:last-child #first_name').html(obj.data[i].first_name);
	    					$('tr:last-child #last_name').html(obj.data[i].last_name);
	    					$('tr:last-child #designation').html(obj.data[i].designation);
	    					$('tr:last-child #sal').html(obj.data[i].sal);
	    					$('tr:last-child #email_id').html(obj.data[i].email_id);
	    					$('tr:last-child #office_address').html(obj.data[i].office_address);
	    					$('tr:last-child #phone_no').html(obj.data[i].phone_no);
	    					$('input[name=selected]').last().click(cheked);
	    				}
	    			});
    			}
    });//ajax
});

